import React from 'react';
import ReactDOM from 'react-dom';
import MainApp from '../public/App'; // Assuming this is where your main App component is defined

const CustomApp = () => {
    return (
        <div>
            This page introduces all parts of the Solarboat project for Knowledge Management.
        </div>
    );
};

ReactDOM.render(
    <React.StrictMode>
        <MainApp />
    </React.StrictMode>,
    document.getElementById('root')
);
